import { Link } from "react-router-dom";
import "./Owner.css";
import Ownernav from "./Ownernav";
import ProductOwners from "./ProductOwner";
import Report from "./Report";



export default function Owner(){
    let pages = 1;

    return(
        <>
            <div className='container-fluid  '>
                <div className='row'>
                    <div className="col-lg-2 p-0 content sidebar" >
                        <Ownernav pages ={pages}/>
                    </div>
                    
                    <div className="col-lg-10 p-0 title content"><br></br>
                                <h1><center>แดชบอร์ด</center></h1><br></br>
                            <div className="col-2">
                                {/* <Link to={"/"} className="btn btn-success ms-3">{<i className="fa-solid fa-plus me-2"></i>}+ เพิ่มข้อมูล</Link> */}
                            </div>
                            <div className="col-10"></div>
                            <Report/>

                            <div className="container content frame">
                                <div className='table'></div>
                            {/* <ProductOwners/> */}
                            </div>
                    </div>
                </div>
            </div>
        </>
    )
}
